class TestCompressedJSONAttributeModel(unittest.TestCase):
    unzipped = {
        "customerId": "088bc64b-6dc7-4f6e-bba2-b891e32e2cdb",
        "transactionType": "Refund",
        "transactionId": "0734ee6f-0fb8-4681-961d-a950000dab98",
        "channelId": "26558",
        "productCode": "angry_birds",
        "price": -0.99,
        "tax": 0.00,
        "total": -0.99,
        "currency": "usd",
        "originalTransactionId": "0734ee6f-0fb8-4681-961d-a950000dab98",
        "originalPurchaseDate": "2014-02-18T18:49:59",
        "partnerReferenceId": "test",
        "comments": "test",
        "responseKey": "c1a73677590948e68215586dfa9455b5"
    }
    zipped = {
        COMPRESSED_KEY: ''}

    def test_json_zip(self):
        self.assertEqual(self.zipped, CompressedJSONAttribute._zip(self.unzipped))

    def test_json_unzip(self):
        self.assertEqual(self.unzipped, CompressedJSONAttribute._unzip(self.zipped))

    def test_compressed_result_is_smaller(self):
        compressed = json.dumps(CompressedJSONAttribute._zip(self.unzipped))
        uncompressed = json.dumps(self.unzipped)
        self.assertLess(len(compressed.encode()), len(uncompressed.encode()))

    def test_apple_receipt_compressed_result_is_smaller(self):
        compressed = json.dumps(CompressedJSONAttribute._zip(apple_receipt))
        uncompressed = json.dumps(apple_receipt)
        self.assertLess(len(compressed.encode()), len(uncompressed.encode()))

    def test_apple_notification_compressed_result_is_smaller(self):
        compressed = json.dumps(CompressedJSONAttribute._zip(apple_notification))
        uncompressed = json.dumps(apple_notification)
        self.assertLess(len(compressed.encode()), len(uncompressed.encode()))

    def test_google_notification_compressed_result_is_smaller(self):
        compressed = json.dumps(CompressedJSONAttribute._zip(google_notification))
        uncompressed = json.dumps(google_notification)
        self.assertLess(len(compressed.encode()), len(uncompressed.encode()))

    def test_attribute_e2e_apple_receipt(self):
        compressor = CompressedJSONAttribute()
        self.assertEqual(apple_receipt, compressor.deserialize(compressor.serialize(apple_receipt)))

    def test_attribute_e2e_apple_notification(self):
        compressor = CompressedJSONAttribute()
        self.assertEqual(apple_notification, compressor.deserialize(compressor.serialize(apple_notification)))

    def test_attribute_e2e_google_notification(self):
        compressor = CompressedJSONAttribute()
        self.assertEqual(google_notification, compressor.deserialize(compressor.serialize(google_notification)))

    def test_deserializes_non_compressed(self):
        compressor = CompressedJSONAttribute()
        self.assertEqual(self.unzipped, compressor.deserialize(json.dumps(self.unzipped)))

    def test_deserializes_None_without_exploding(self):
        compressor = CompressedJSONAttribute()
        self.assertIsNone(compressor.deserialize(json.dumps(None)))


if __name__ == '__main__':
    unittest.main()
